/*Table structure for table `h2_api` */

DROP TABLE IF EXISTS `h2_api`;

CREATE TABLE `h2_api` (
  `api_id` varchar(32) NOT NULL,
  `sp_id` varchar(32) NOT NULL,
  `api_max_in` int(10) DEFAULT NULL COMMENT '访问控制',
  `api_enabled` tinyint(1) NOT NULL DEFAULT '1' COMMENT 'api是否可用',
  `api_description` text,
  `api_path` varchar(255) NOT NULL COMMENT '访问代理使用的路径',
  `api_name` varchar(255) NOT NULL,
  `api_bill_type` int(2) NOT NULL COMMENT 'api记账类型，0：按次数：1，按流量M',
  `api_method` int(1) NOT NULL DEFAULT '0' COMMENT '0：get 1：post，2：两种都有',
  `api_url` varchar(255) NOT NULL,
  `api_return_pattern` int(1) NOT NULL COMMENT 'api的返回格式，0:application/json,1:text/xml,2:multipart/form-data,3:application/x-www-form-urlencoded ',
  `api_normal_return_demo` text,
  `api_error_return_demo` text,
  `api_timeout` int(6) NOT NULL DEFAULT '30000' COMMENT 'api超时时间',
  `api_category_id` varchar(32) NOT NULL DEFAULT 'default' COMMENT 'api分类编码，同一类api拥有相同的前缀',
  `api_average_response_time` float DEFAULT '99' COMMENT '近200次访问请求的平均响应时间',
  `api_ok_response_times` int(11) DEFAULT '0' COMMENT 'api在近1000次访问请求中的成功次数',
  `api_success_response_ratio` float NOT NULL DEFAULT '0.5' COMMENT 'api返回成功的比率',
  `api_time_algorithm_score` float DEFAULT '0' COMMENT 'api按照时间算法得到的分数',
  `api_stable_algorithm_score` float DEFAULT '0' COMMENT '稳定性算法得分',
  `api_cost_algorithm_score` float DEFAULT '0',
  `api_jar_path` varchar(512) DEFAULT NULL,
  `api_env` int(1) DEFAULT '0' COMMENT '0：测试，1：线上',
  `api_verify_state` int(1) DEFAULT '0' COMMENT '0：未通过审核，1:已经通过审核，正在适配，2：已经通过审核，适配完毕',
  `api_param_xml` text COMMENT 'api参数的xml描述文档',
  `api_adapt_state` int(1) DEFAULT NULL,
  `api_create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `api_request_body` text COMMENT 'api请求体样例',
  `api_request_contenttype` varchar(128) DEFAULT NULL,
  PRIMARY KEY (`api_id`),
  UNIQUE KEY `api_id` (`api_id`) USING HASH,
  KEY `api_sp` (`sp_id`),
  CONSTRAINT `api_sp` FOREIGN KEY (`sp_id`) REFERENCES `h2_service_provider` (`sp_id`) ON DELETE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

